/**
* Generate a icon check
* @return icon_check
*/
function icon_check() {
    var icon= document.createElement('i');
    icon.className+="icon fa fa-check-circle";
    icon.setAttribute("aria-hidden","true");
    icon.title="si existe";
    return icon;
}


